import axios from 'axios'
import { API } from '../../util/constant/constant';
const PATH = API.cafe;
const service = {
    /**
     * 카페 관리 - 로스팅 단계 등록
     * 
     * @author Dong-Min Seol
     * @since  2019.09.22
     */
    registerRoastHistory: (data) => {

        return axios.post(`${PATH}/enrollGoods_roaster`, data)
            .then(res => {
                return res.status == 200 ? true : false;
            })
    },

    /**
     * 카페 관리 - 상품 출고 등록
     * 
     * @author Dong-Min Seol
     * @since  2019.09.22
     */
    registerGoodsRelease: (data) => {
        return axios.post(`${PATH}/sendGoods_roaster`, data)
            .then(res => {
                return res.status == 200 ? true : false;
            })
    },
    /**
     * 카페 관리 - 도착 날자 등록
     * 
     * @author Dong-Min Seol
     * @since  2019.09.22
     */
    registerDeliverDate: (data) => {
        return axios.post(`${PATH}/enrollArriveTime_roaster`, data)
            .then(res => {
                return res.status == 200 ? true : false;
            })
    }

}

export default service;
